    // }
    

    // //La fonction pour modifier les informations:
    const Changer = async (e) => {
        e.preventDefault();
        console.log("hhh")
    }
    
        
    
        return (
            <div>
            <Navbar className="row p-2 d-flex" color="light">
            <NavbarBrand className='col-7 d-flex justify-content-start ms-4' href="/">
              <img alt="logo" src="Nexadz.png" className='' style={{height: 25,width: 100}}/>
            </NavbarBrand>
            <NavbarText className='col-3 d-flex justify-content-end'>
              <div className='d-flex'>
                <div><img alt="" src="person.svg" className=' p-2 mt-2 me-2 img1'/></div>
                <div className='me-3'>
                  <div className='txt1'>Administrator</div>
                  <div>
                  <UncontrolledDropdown>
                  <DropdownToggle nav caret>
                    {nom}
                  </DropdownToggle>
                  <DropdownMenu right>
                    <DropdownItem className='d-flex'><div><img alt="" src="person.svg" className='me-2'/></div><div>View Profile</div></DropdownItem>
                    <DropdownItem divider />
                    <DropdownItem className='d-flex'><div><img alt="" src="sigout.svg" className='me-3'/></div><div>Sign out</div></DropdownItem>
                  </DropdownMenu>
                </UncontrolledDropdown>
                  </div>
                </div>
              </div>
            </NavbarText>
        
        </Navbar>    
        <div className='container-lg'>
            <div className='row'>

           <div class="card col-lg-3 p-2 ms-4" onClick={Changer}>
            <img src="backImg.png" class="card-img-top" alt="tmp"/>
                <div class="card-body">
                    <h5 class="card-title">Them 1</h5>   
                </div>
            </div>

            <div class="card col-lg-3 p-2 ms-4" onClick={Changer}>
            <img src="backImg.png" class="card-img-top" alt="tmp"/>
                <div class="card-body">
                    <h5 class="card-title">Them 1</h5>   
                </div>
            </div>

            <div class="card col-lg-3 p-2 ms-4" onClick={Changer}>
            <img src="backImg.png" class="card-img-top" alt="tmp"/>
                <div class="card-body">
                    <h5 class="card-title">Them 1</h5>   
                </div>
            </div>

            </div>
            </div>
            
        </div>
        );
     
        
      }
      
      export default Them;
